    "d\\b", ".", "abc", "a(?=a)", "a(?=a)", "a\\n", "a(?!a)", "^a(?!a)", "(?=(a+))", "a(?=a(?=b))",
    ".+:", "(?<=(?<!b)a)a", "\\s", "()|"
