    param_init_data_types: {"param1": "String[]"},
    param_types: {"param1": "String"},
    param_nature: {"param1": object},
    param_list: {"param1": '[
    "table football", "abc", "cabd", "aabaac", "aabaac", "b", "zaacbbbcac", "ab\nabc", "ab\nabc", "erv",
